import { Component, Input } from '@angular/core';

@Component({
  selector: 'sidebar-item-section',
  templateUrl: './sidebar-item-section.component.html',
  styleUrls: ['./sidebar-item-section.component.css'],
})
export class SidebarItemSectionComponent {
  @Input() name: string;

  constructor() {
    this.name = '';
  }
}
<div class="mt-6 md:pl-6">
  <div>
    <div class="mb-10">
      <div class="mb-4 pl-5 text-lg font-medium text-gray-500 lg:pl-6">
        {{ name }}
      </div>
      <ng-content />
    </div>
  </div>
</div>
